import React, { useState } from "react";
import { useNavigate } from "react-router-dom";
import heroImage from "../images/hero-bg.jpg";

const PartnershipSearch = () => {
  const navigate = useNavigate();
  const [activeTab, setActiveTab] = useState("location");
  const [formData, setFormData] = useState({
    state: "",
    city: "",
    orgType: "",
    goal: "",
  });

  const US_STATES = [
    "Alabama",
    "Alaska",
    "Arizona",
    "Arkansas",
    "California",
    // ... 其他州
  ];

  const CITIES = {
    California: ["Los Angeles", "San Francisco", "San Diego"],
    // ... 其他城市
  };

  return (
    <div className="min-h-screen relative">
      {/* 背景图片 */}
      <div className="absolute inset-0 z-0">
        <img
          src={heroImage}
          alt="Background"
          className="w-full h-full object-cover"
          style={{
            filter: "brightness(0.7) saturate(0.7)",
          }}
        />
        <div className="absolute inset-0 bg-teal-900/30 mix-blend-multiply" />
      </div>

      {/* 返回按钮 */}
      <button
        onClick={() => navigate(-1)}
        className="absolute top-8 left-8 z-10 text-white hover:text-teal-200 transition-colors"
      >
        <svg
          className="w-8 h-8"
          fill="none"
          stroke="currentColor"
          viewBox="0 0 24 24"
        >
          <path
            strokeLinecap="round"
            strokeLinejoin="round"
            strokeWidth={2}
            d="M10 19l-7-7m0 0l7-7m-7 7h18"
          />
        </svg>
      </button>

      {/* 主要内容 */}
      <div className="relative z-10 pt-32 px-4 sm:px-6 lg:px-8">
        <h1 className="text-center text-5xl font-bold text-white mb-12">
          Let's Find Your Perfect Partner
        </h1>

        <div className="max-w-4xl mx-auto bg-white rounded-lg shadow-xl overflow-hidden">
          {/* 标签栏 */}
          <div className="flex border-b">
            <button
              className={`flex-1 px-6 py-4 text-sm font-medium ${
                activeTab === "location"
                  ? "text-teal-600 border-b-2 border-teal-500 bg-teal-50"
                  : "text-gray-500 hover:text-teal-500"
              }`}
              onClick={() => setActiveTab("location")}
            >
              📍 Location
            </button>
            <button
              className={`flex-1 px-6 py-4 text-sm font-medium ${
                activeTab === "type"
                  ? "text-teal-600 border-b-2 border-teal-500 bg-teal-50"
                  : "text-gray-500 hover:text-teal-500"
              }`}
              onClick={() => setActiveTab("type")}
            >
              🏢 Organization Type
            </button>
            <button
              className={`flex-1 px-6 py-4 text-sm font-medium ${
                activeTab === "goal"
                  ? "text-teal-600 border-b-2 border-teal-500 bg-teal-50"
                  : "text-gray-500 hover:text-teal-500"
              }`}
              onClick={() => setActiveTab("goal")}
            >
              🎯 Partnership Goal
            </button>
          </div>

          {/* 内容区域 */}
          <div className="p-6">
            {activeTab === "location" && (
              <div className="grid grid-cols-2 gap-4">
                <div>
                  <label className="block text-sm font-medium text-gray-700 mb-1">
                    State
                  </label>
                  <select
                    className="w-full rounded-md border-gray-300 shadow-sm focus:border-teal-500 focus:ring-teal-500"
                    value={formData.state}
                    onChange={(e) =>
                      setFormData({ ...formData, state: e.target.value })
                    }
                  >
                    <option value="">Select State</option>
                    {US_STATES.map((state) => (
                      <option key={state} value={state}>
                        {state}
                      </option>
                    ))}
                  </select>
                </div>
                <div>
                  <label className="block text-sm font-medium text-gray-700 mb-1">
                    City
                  </label>
                  <select
                    className="w-full rounded-md border-gray-300 shadow-sm focus:border-teal-500 focus:ring-teal-500"
                    value={formData.city}
                    disabled={!formData.state}
                  >
                    <option value="">Select City</option>
                    {formData.state &&
                      CITIES[formData.state]?.map((city) => (
                        <option key={city} value={city}>
                          {city}
                        </option>
                      ))}
                  </select>
                </div>
              </div>
            )}

            {activeTab === "type" && (
              <div className="space-y-4">
                <button
                  className={`w-full p-4 text-left rounded-lg border-2 transition-colors ${
                    formData.orgType === "nonprofit"
                      ? "border-teal-500 bg-teal-50"
                      : "border-gray-200 hover:border-teal-200"
                  }`}
                  onClick={() =>
                    setFormData({ ...formData, orgType: "nonprofit" })
                  }
                >
                  <div className="flex items-center">
                    <span className="text-2xl mr-3">🌍</span>
                    <div>
                      <h3 className="font-medium text-gray-900">
                        Nonprofit Organization
                      </h3>
                      <p className="text-sm text-gray-500">
                        NGOs, charities, and social organizations
                      </p>
                    </div>
                  </div>
                </button>
                <button
                  className={`w-full p-4 text-left rounded-lg border-2 transition-colors ${
                    formData.orgType === "forprofit"
                      ? "border-teal-500 bg-teal-50"
                      : "border-gray-200 hover:border-teal-200"
                  }`}
                  onClick={() =>
                    setFormData({ ...formData, orgType: "forprofit" })
                  }
                >
                  <div className="flex items-center">
                    <span className="text-2xl mr-3">💼</span>
                    <div>
                      <h3 className="font-medium text-gray-900">
                        For-Profit Business
                      </h3>
                      <p className="text-sm text-gray-500">
                        Companies looking to make social impact
                      </p>
                    </div>
                  </div>
                </button>
              </div>
            )}

            {activeTab === "goal" && (
              <div>
                <label className="block text-sm font-medium text-gray-700 mb-1">
                  What Kind of Organization Are You Looking For?
                </label>
                <textarea
                  className="w-full rounded-md border-gray-300 shadow-sm focus:border-teal-500 focus:ring-teal-500"
                  rows="4"
                  placeholder="Describe your ideal partnership..."
                  value={formData.goal}
                  onChange={(e) =>
                    setFormData({ ...formData, goal: e.target.value })
                  }
                />
              </div>
            )}
          </div>

          {/* 搜索按钮 */}
          <div className="px-6 py-4 bg-gray-50 border-t border-gray-200">
            <button className="w-full sm:w-auto float-right px-6 py-2 bg-teal-600 text-white rounded-md hover:bg-teal-700 focus:outline-none focus:ring-2 focus:ring-offset-2 focus:ring-teal-500">
              Search Partners
            </button>
          </div>
        </div>
      </div>
    </div>
  );
};

export default PartnershipSearch;
